<!-- 登陆模块 -->
<template>
<div class="login-wrap" v-loading="loading" element-loading-text="拼命加载中">
  <div class="login-header">
    <span class="header-icon icon"></span>
  </div>
  <div class="login-content">
    <span class="conter-bg"></span>
    <div class="form-content primary-color-bg-white">
      <div class="title primary-color boder-bottom">用户登录</div>
      <el-form class="login-form" autoComplete="on" :model="loginForm" ref="loginForm">

        <el-form-item prop="username" class="form-input">
          <el-input name="username" type="number" v-model="loginForm.account" autoComplete="on" placeholder="请输入登录账号">
            <template class="input-title" slot="prepend">用户名:</template>
          </el-input>
        </el-form-item>

        <el-form-item prop="password" class="form-input">
          <el-input name="password" type="password" @keyup.enter.native="handleLogin" v-model="loginForm.password" autoComplete="on" placeholder="请输入登录密码">
            <template class="input-title" slot="prepend">密码:</template>
          </el-input>
        </el-form-item>

        <el-form-item>
          <el-button class="form-btn" type="primary" @click.native.prevent="handleLogin">登录</el-button>
        </el-form-item>
        <el-form-item class="remember">
          <el-checkbox v-model="checked">记住密码</el-checkbox>
        </el-form-item>
      </el-form>
    </div>
  </div>
</div>
</template>

<script>
import md5 from "md5";
export default {
  name: "login",
  created() {},
  data() {
    return {
      loginForm: {
        account: "",
        password: ""
      },
      checked: true,
      loading: false
    };
  },
  methods: {
    // 登陆
    handleLogin() {
      if (!this.loginForm.account || !this.loginForm.account) {
        this.$ele.Notification.error({
          title: "错误",
          message: "帐号或密码不能为空！"
        });
        return;
      }
      let params = {
        account: this.loginForm.account,
        password: md5(this.loginForm.password)
      };
      this.loading = true;

      this.$customAxios
        .post("login2", params)
        .then(resq => {
          this.loading = false;
          //登陆成功
          this.$ele.Notification({
            message: "登陆成功",
            type: "success"
          });
          this.$cookies.set("userInfo", resq, 7);
          this.$cookies.set("sessionId", resq.sessionId, 7);
          //缓存
          if (!!this.checked) {
            this.$cookies.set("account", params.account, 7);
            this.$cookies.set("password", params.password, 7);
          } else {
            this.$cookies.remove("account");
            this.$cookies.remove("password");
          }

          window.location.href = "./index.html";
          this.clearCookie();
        })
        .catch(error => {
          this.loading = false;
        });
    },
    // 清除缓存
    clearCookie() {
      this.$cookies.remove("navberObj");
      this.$cookies.remove("menuIndex");
      this.$cookies.remove("renderRouter");
    }
  }
};
</script>

